import React from 'react';
import ReactPlayer from 'react-player'
// import video from './videos/18.mp4'
const Player = () => {
    const video = './videos/18.mp4'
    return(
    <ReactPlayer 
    url={video}
    playing={true}
    controls={true} 
    width={"100%"}
    height={"65vh"}
    />
    )
}

export default Player;
